import React from "react";
import styled from "styled-components";

const StyleGame = styled.div`
    background-color: #102027;
    width: 800px;
    height: 1000px;
`;

const H2 = styled.div`
    background-color: red;
    width: 20px;
    height: 20px;
`;

const Game = () => {
    return <StyleGame>12</StyleGame>;
};

export default Game;
